import React from 'react'
import PropTypes from 'prop-types';
// import '../styles/nav.scss';

export const Nav = () => {

    const itemsNav = [
        {
            linkItem: '#',
            item: 'item1'
        },
        {
            linkItem: '#',
            item: 'item2'
        },
        {
            linkItem: '#',
            item: 'item3'
        },
        {
            linkItem: '#',
            item: 'item4'
        },
    ]

    return (
        <nav className='Nav'>
            <ul>
                {itemsNav.map(items => (
                    <li>
                        <a href={items.linkItem}>{items.item}</a>
                    </li>
                ))}
            </ul>
        </nav>
    );
};
